import React from "react";

const LeaderBoard = props => {
  return (
    <table>
      <caption>LeaderBoard</caption>
      <thead>
        <tr>
          <th>Name</th>
          <th>Score</th>
        </tr>
      </thead>
      <tbody>
        {props.LeaderBoard.map(member => {
          return (
            <tr>
              <td>{member.name}</td>
              <td>{member.score}</td>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default LeaderBoard;
